import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const Detail = () => {
  const { id } = useParams(); // Obtiene el ID de la URL
  const [dentist, setDentist] = useState(null);

  useEffect(() => {
    // Realiza la llamada a la API para obtener los detalles del dentista
    fetch(`https://jsonplaceholder.typicode.com/users/${id}`)
      .then(response => response.json())
      .then(data => setDentist(data))
      .catch(error => console.error('Error fetching dentist details:', error));
  }, [id]);

  if (!dentist) {
    return <p>Loading...</p>; // Muestra un mensaje de carga mientras se obtienen los datos
  }

  return (
    <div className="detail-container">
      <h2>{dentist.name}</h2>
      <p><strong>Username:</strong> {dentist.username}</p>
      <p><strong>Email:</strong> {dentist.email}</p>
      <p><strong>Phone:</strong> {dentist.phone}</p>
      <p><strong>Website:</strong> {dentist.website}</p>
      <p><strong>Company:</strong> {dentist.company.name}</p>
      <p><strong>Address:</strong> {`${dentist.address.street}, ${dentist.address.city}, ${dentist.address.zipcode}`}</p>
    </div>
  );
};

export default Detail;
